import React from "react";
import { useEffect } from "react";
import axios from "axios";


function Home() {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:3000/users')    
      .then(res=>{
setData(res.data)})
      .catch(err=>{
console.log(err)});

    }, []);

  return (

    <React.Fragment>
         <div className="container d-flex flex-column justify-content-center align-items-center vh-100">
         <h1 className="text-primary fw-bold">LIST OF USERS</h1>
         <table className="table table-stripped table-hover bg-warning">
            <thead>
                <th>ID</th>
                <th>NAME</th>
                <th>EMAIL</th>
                <th>PHONE</th>
                <th>ACTION</th>
            </thead>
            <tbody>
                {
                    data.map((data, index) =>{
                        return(
                            <tr key={index}>
                            <td>{data.id}</td>
                            <td>{data.name}</td>
                            <td>{data.email}</td>
                            <td>{data.phone}</td>
                            <td>{data.website}</td>
                                    </tr>
                        )
                    })


                }
            </tbody>        

         </table>

         </div>

    </React.Fragment>

  )
}

export default Home;
